import React from 'react'
import "./Navigation.css"
const Navigation = () => {
    return (
        <div className = "body">
            <div className="container">
                <div className="navbar">

                    <ul>

                        <li className="logo"> <a href="/"> rosa swaby  </a> </li>

                        <section className="div_navbar_items">
                            <li className="navbar_items"> <a href="/"> home </a> </li>
                            <li className="navbar_items"> <a href="/About"> about me </a> </li>
                        </section>

                    </ul>
                </div>
            </div>
        </div>
    );

}

export default Navigation;
